import styled from '@emotion/styled'
import notification from './assets/notification.svg'

const Container = styled.div`
    position: absolute;
    top: 30px;
    right: 30px;
`

const Profile = () => (
    <div>
        <Container>
            <img src={notification} />
        </Container>
    </div>
)




export default Profile;
